'''Regath''' is the owner of [[Regath's Wares]] in [[Arceuus]].

Despite his shop being marked as a general store on the [[World map]], his wares are more suitable for a [[Magic shops|magic shop]]. He plays a small role in the [[Client of Kourend]] quest.

==Treasure Trails==
{{Anagram|Regath|elite|AT HERG}}. The answer to his elite challenge clue is '''25'''.

